import React from 'react';
import './style.css'
import { useState } from 'react';

function Square(){
    const [vlaue, setValue] = useState(null)

    function hendClick(){
        setValue('X')
    }
    return(
        <button onClick={hendClick} className='square'>{vlaue}
        </button>
    )
}


function Board() {
    const [squares, setSquares] = useState(Array(9).fill(null))
    return (
        <div>
            <div className='board-row'>
                <Square vlaue={squares[0]}/>
                <Square vlaue={squares[1]}/>
                <Square vlaue={squares[2]}/>
            </div>
            <div className='board-row'>
                <Square vlaue={squares[3]}/>
                <Square vlaue={squares[4]}/>
                <Square vlaue={squares[5]}/>
            </div>
            <div className='board-row'>
                <Square vlaue={squares[6]}/>
                <Square vlaue={squares[7]}/>
                <Square vlaue={squares[8]}/>
            </div>
        </div>
    )
  }

  export default function App(){
    return(
        <Board/>
    )
  }
